import React from 'react';

export default class SocialCard extends React.Component{
    render(){
        const {author, post} = this.props.info;
        console.log(author, post);
        return (
            <article className='card text-center border-dark mb-3' style={{maxWidth: "18rem"}}>
                <div className='card-header bg-transparent border-dark'>Header</div>
                <div className='card-body text-dark'>
                    img
                    <h5 className='card-title'>Title</h5>
                    <p className='card-text'>Text</p>
                </div>
                <div class="card-footer bg-transparent border-dark">Footer</div>
            </article>
        )
    }
}
